import React from "react";

const NotFound = () => {
  return (
    <div className="not-found">
        <ul>
     <li> <h1 className="display-1">Error 404</h1></li>
      <li><h2 >Page Not Found</h2></li>
      <h3 >The requested URL was not found in this server.</h3></ul>
    </div>
  );
};

export default NotFound;
